        public string GetBase64Image(string img)
        {
            try
            {
                var ext = Path.GetExtension(img);
                return $"data:image/{ext};base64,{Convert.ToBase64String(File.ReadAllBytes(Path.Combine(imagePath, img)))}";
            }
            catch (Exception ex)
            {
                Log.Error($"Exception getting image {img}. Ex: {ex.Message}");
                Log.Debug(ex.StackTrace);
                return
                    "data:image/png;base64,";
            }
        }
